  },
  ['Of Coursers We Know'] = {
    ['Acquire 4 Healthy Courser Glands and bring them to Ogtinc in Azshara.  Ogtinc resides atop the cliffs northeast the Ruins of Eldarath.'] = 2636950756
  },
  ['Return to Lewis'] = {
    ['Buy a gryphon ride to Sentinel Hill from the gryphon master Dungar Longdrink, then take Osric\'s Crate to Lewis at Sentinel Hill.'] = 650686554
  },
  ['Manna-Enriched Horse Feed'] = {
    ['Retrieve 20 Enriched Manna Biscuits - the key ingredient in making Manna-Enriched Horse Feed - for Merideth Carlson at Southshore in the Hillsbrad Foothills.  The Argent Dawn is known as the sole purveyor of the biscuits.\n\nYou also need to give her 50 gold to soothe her ruffled sensibilities.'] = 967538737
  },
  ['Torwa Pathfinder'] = {
    ['Speak with Torwa Pathfinder in Un\'Goro Crater.'] = 3893841258
  },
  ['The Ensorcelled Parchment'] = {
    ['Take the Ensorcelled Parchment to Loremaster Dibbs in Southshore.'] = 1397973495
  },
  ['Magatha\'s Payment to Jediga'] = {
    ['Deliver Magatha\'s Note to Jediga in Azshara.'] = 1052134501
  },
  ['Sample for Helbrim'] = {
    ['Bring the Wolf Heart Sample to Apothecary Helbrim in the Barrens.'] = 2855201515
  },
  ['A Bijou for Zanza'] = {
    ['Destroy any one of the Hakkari Bijous found in Zul\'Gurub at the Altar of Zanza on Yojamba Isle.  When done, speak with Vinchaxa nearby.'] = 1681432159
  },
  ['Again With the Zapped Giants'] = {
    ['Use Zorbin\'s Ultra-Shrinker to zap any kind of giant found in Feralas into a more manageable form.  Bring 10 Miniaturization Residues found on the zapped versions of these giants to Zorbin Fandazzle at the docks of the Forgotten Coast, Feralas.'] = 1798497634
  },
  ['Natural Materials'] = {
    ['Bring 2 Splintered Logs, 6 Encrusted Minerals, 20 pieces of Resilient Sinew, and 40 Metallic Fragments to Witch Doctor Uzer\'i in Camp Mojache.'] = 1977015620
  },
  ['The Last Element'] = {
    ['Travel to Blackrock Depths and recover 10 Essence of the Elements. Your first inclination is to search the golems and golem makers. You remember Vivian Lagrave also muttering something about elementals.'] = 4149761861
  },
  ['The Absent Minded Prospector'] = {
    ['Take the mysterious fossil to Chief Archaeologist Greywhisker in Darnassus.'] = 1560490287,
    ['Travel south and check on Prospector Remtravel.'] = 3544721025,
    ['Protect Prospector Remtravel as he searches for the mysterious fossil, then return to Archaeologist Hollee in Auberdine.'] = 3726983616,
    ['Take the mysterious fossil to Archaeologist Flagongut in Menethil Harbor.'] = 712912963,
    ['Archaeologist Flagongut in Menethil Harbor wants you to bring him the Stone of Relu and Flagongut\'s Fossil.'] = 2251832542
  },
  ['Salve via Gathering'] = {
    ['A Cenarion beacon allows a seasoned herbalist to spot insidious fel creep - a malfeasant product of Felwood\'s corruption. My work here has taught me the knowledge of purifying fel creep into a cleansing reagent... used in what we now refer to as Cenarion plant salve.\n\nWhen you gather herbs in Felwood, you should encounter the fel creep so long as you have the beacon. In exchange for what you bring to me, I will give you pre-made Cenarion plant salve.'] = 122814934
  },
  ['Prospect of Faith'] = {
    ['Take Hammertoe\'s Amulet to Historian Karnik in Ironforge.'] = 1433091758,
    ['Take Hammertoe\'s Amulet to Prospector Ryedol in the Badlands.'] = 2924757004
  },
  ['The Ashenvale Hunt'] = {
    ['Speak with Senani Thunderheart at Splintertree Post, Ashenvale.'] = 2090048586,
    [''] = 2422834433
  },
  ['In Search of Menara Voidrender'] = {
