    ['Speak to Menara Voidrender in the Barrens.'] = 1155835601
  },
  ['Making Sense of It'] = {
    ['Speak with J.D. Collie in a moment.'] = 1369872617
  },
  ['The Newest Member of the Family'] = {
    ['Take your Fragile Sprite Darter Egg to the Hinterlands and speak to Agnar Beastamer, but hurry, you only have 1 hour to find him before the hatchling within the egg dies.'] = 2450311251
  },
  ['The Bounty of Teldrassil'] = {
    ['Bring Nessa\'s Collection to Vesprystus.'] = 983630076
  },
  ['Wild Guardians'] = {
    ['Trull Failbane in Felwood wants you to kill 15 Raging Owlbeasts and 15 Ragged Owlbeasts.'] = 3155959005,
    ['Trull Failbane in Felwood wants you to hunt 10 Berserk Owlbeasts in Winterspring.'] = 4230880301,
    ['Trull Failbane in Felwood wants you to hunt 13 Moontouched Owlbeasts.'] = 3110475652
  },
  ['Set Them Ablaze!'] = {
